import React from 'react';

function Footer() {
    return (
        <section>
            <h1 id="footer">Ways to find me</h1>

            <ul>
                <li><a href="mailto:qmalavejose1@gmail.com" target="_blank" rel="noreferrer">Email</a></li>
                <li><a href="http://github.com/jmalave15" target="_blank" rel="noreferrer">Github</a></li>
                <li><a href="http://linkedin.com" target="_blank" rel="noreferrer">Linkedin</a></li>
            </ul>
        </section>
    );
}

export default Footer;
